export function optionVizScatter1(data: {[key: string]: number[][]}, fsize: number): Object {
    return (
        {
            xAxis: {
                min: 'dataMin'
            },
            yAxis: {
                min: 'dataMin'
            },
            series: [
                {
                    symbolSize: 10,
                    data: data["0"],
                    type: 'scatter',
                    color: 'green'
                },
                {
                    symbolSize: 10,
                    data: data["1"],
                    type: 'scatter',
                    color: 'red'
                }

            ]
        }
    )
}
